define('core/BaseView',[
	'underscore',
	'backbone'
], function(_, Backbone){

	var BaseView = Backbone.View.extend({

		close : function(){
			if(this.childViews){
				this.childViews.close();
			}
			this.remove();
		},

		destroyView: function() {
		    if (this.model !== 'undefined') {
		        this.model.off();
		    }
			// COMPLETELY UNBIND THE VIEW
			this.undelegateEvents();
			this.$el.removeData().unbind();
			// Remove view from DOM
			this.remove();
			Backbone.View.prototype.remove.call(this);
		},

		disabledAction: function(disabled) {
			$('.action-entuliga').prop("disabled", disabled);
		}
	});

	return BaseView;

});
define('models/UserModel',[
  'backbone'
], function(Backbone) {

  var UserModel = Backbone.Model.extend({

    urlRoot: 'user',

    defaults: {

      username: '',
      roles: '',
      password: '',
      passwordConfirm: '',
      name: '',
      email: '',
      is_admin: false
    },

    initialize: function() {},


    validation: {
      username: [{
        required: true,
        maxLength: 50,
        msg: 'El campo es requerido'
      }, {
        pattern: 'email',
        msg: 'Por favor especifique un email correcto.....'
      }],
      password: {
        required: true,
        pattern: /^(?=.*\d)(?=.*[a-z])(?=.*[A-Z]).{4,8}$/,
        msg: 'El password debe tener por lo menos una letra mayuscula, una minuscula y un numero'
      },
      passwordConfirm: {
        required: true,
        equalTo: 'password',
        msg: 'El password no coincide'

      }
    }

  });

  return UserModel;
});

