define('models/LigaModel',[
    'backbone'
], function(Backbone){

    var LigaModel = Backbone.Model.extend({

        urlRoot: 'liga',

        defaults: {
            nombre: '',
            nombreCompleto: '',
            telefono: '',
            calle: '',
            noExterior: '',
            noInterior: '',
            codigoPostal: '',
            coloniaId: '',
            coloniaDesc: '',
            municipioDesc: '',
            estadoDesc: '',
            paisDesc: '',
            longitude: '',
            latitude: ''
        },

        initialize: function() {
          _.each(this.attributes, function (val, key) {
            this.set(key, this.sanitize(val));
          }, this);
        },

        sanitize: function (str) {
          return _.escape(str);
        },


        validation: {
            nombre: {
                required: true
            },
            nombreCompleto: {
                required: true
            },
            telefono: {
                minLength: 8
            },
            calle: {
                required: true
            },
            noExterior: {
                required: true
            },
            noInterior: {
                required: false
            },
            codigoPostal: {
                required: true
            },
            coloniaId: {
                required: true
            },
            longitude: {
                required: false
            },
            latitude: {
                required: false
            }
        }

    });

	return LigaModel;
});

define('collections/LigasCollection',[
	'backbone',
    'models/LigaModel'
], function(Backbone, LigaModel){

    var LigasCollection = Backbone.Collection.extend({
        model: LigaModel,
        url: 'liga'
    });

	return LigasCollection;
});

