define('views/private/partido/RowPartidoTorneoJugadorView',[
	'jquery',
	'underscore',
	'core/BaseView',
	'text!templates/private/partido/tplRowPartidoTorneoJugador.html'
], function($, _, BaseView, tplRowPartidoTorneoJugador){

	var RowPartidoTorneoJugadorView = BaseView.extend({
        template: _.template(tplRowPartidoTorneoJugador),
        tagName: 'tr',

        events: {
        },

        initialize: function(modelo) {
            this.model =  modelo;
        },

        render: function() {
            this.$el.html(this.template(this.model.toJSON()));
            return this;
        },

        destroyView: function() {
            // COMPLETELY UNBIND THE VIEW
            this.undelegateEvents();
            this.$el.removeData().unbind();
            // Remove view from DOM
            this.remove();
            Backbone.View.prototype.remove.call(this);
        }
	});

	return RowPartidoTorneoJugadorView;

});

define('text!templates/private/partido/tplPartidoEquipo.html',[],function () { return '<div class="panel panel-default">\n    <div class="panel-heading">\n        <h3 class="panel-title">Local</h3>\n    </div>\n    <div class="panel-body">\n        <table id="all-jugadores" class="table table-condensed">\n            <thead>\n            <tr>\n                <th>#</th>\n                <th>Jugador</th>\n                <th>Posicion</th>\n            </tr>\n            </thead>\n            <tbody>\n            </tbody>\n        </table>\n    </div>\n</div>';});

define('views/private/partido/PartidoEquipoView',[
	'jquery',
	'backbone',
	'core/BaseView',
	'models/TorneoPartidoModel',
	'models/TorneoEquipoModel',
	'collections/TorneoJugadoresCollection',
	'views/private/partido/RowPartidoTorneoJugadorView',
	'text!templates/private/partido/tplPartidoEquipo.html'
], function($, Backbone, BaseView, TorneoPartidoModel, TorneoEquipoModel,
            TorneoJugadoresCollection, RowPartidoTorneoJugadorView, tplPartidoEquipo){

	var PartidoLocalView = BaseView.extend({
	    el: '#section-equipo',
        template: _.template(tplPartidoEquipo),

        events: {

        },

        initialize: function(opts) {
            this.model = opts.modelo;
            this.parent = opts.parent;
            this.type = opts.type;
            this.$el = $('#section-'+ this.type);
            this.jugadores = new TorneoJugadoresCollection();
            this.listenTo(this.jugadores, 'add', this.agregarJugador);
            this.listenTo(this.jugadores, 'sync', this.syncJugadores);
            this.render();

            var local = new TorneoEquipoModel({ id : this.model.get(this.type.toLowerCase() + 'Id') });
            this.jugadores.setTorneoEquipo(local);
            this.jugadores.fetch();
        },

        render: function() {
            this.$el.html(this.template(this.model.toJSON()));
        },

        agregarJugador: function(model) {
            var vista = new RowPartidoTorneoJugadorView(model);
            this.$el.find("#all-jugadores").find('tbody:last').append(vista.render().$el);
            
        },

        syncJugadores: function() {
            this.parent.addPlayers(this.jugadores, this.type);
        }
	});

	return PartidoLocalView;

});
define('collections/ArbitrosPartidoCollection',[
	'backbone',
    'models/ArbitroPartidoModel'
], function(Backbone, ArbitroPartidoModel){

    var ArbitrosPartidoCollection = Backbone.Collection.extend({
        model: ArbitroPartidoModel,
        url: function() {
            return 'torneopartido/' + this.partido.get('id') + '/partidoarbitro';
        },
        setTorneoPartido: function(model){
            this.partido = model;
        }
        
    });

	return ArbitrosPartidoCollection;
});

